import React, { Component } from "react";

export class Dashboard extends Component {
  render() {
    if (this.props.isLogedIn === false) {
      return (
        <div>
          <h4>Please sign in or register!</h4>
        </div>
      );
    }
    return (
      <div>
        <h4>Welcome Back!</h4>
      </div>
    );
  }
}

export default Dashboard;
